        public static string GetPinyin(char chCn)
        {
            int num = (int)chCn;
            if (num < 19968 || num > 40959)
                return "";
            int index1 = (int)chCn - 19968;
            int pinyinDict = (int)PinyinConverter.PinyinDictArray[index1];
            if (pinyinDict >= 0)
                return PinyinConverter.GlobalPinyinList[pinyinDict];
            if (pinyinDict == -1)
                return new string(chCn, 1);
            int index2 = -pinyinDict - 2;
            long multiPinyin = PinyinConverter.MultiPinyinList[index2];
            IList<string> stringList = (IList<string>)new List<string>();
            int index3 = (int)(multiPinyin & 4095L);
            while (multiPinyin > 0L)
            {
                stringList.Add(PinyinConverter.GlobalPinyinList[index3]);
                multiPinyin >>= 12;
                index3 = (int)(multiPinyin & 4095L);
            }
            return string.Join(" ", (IEnumerable<string>)stringList);
        }

        public static string GetPinyinFirstChar(char chCn)
        {
            string str = "";
            int key = (int)chCn;
            if (key > 40869 || key < 19968)
                return str;
            return PinyinConverter._multiPinyinFirstCharDict.ContainsKey(key) ? PinyinConverter._multiPinyinFirstCharDict[key] : ""[key - 19968].ToString((IFormatProvider)CultureInfo.InvariantCulture);
        }

        public static bool IsValidCnChar(char ch) => ch >= '一' && ch <= '\x9FFF';
